import { Card, CardBody, CardHeader, FormGroup } from "reactstrap";
import Base from "../components/Base";

const Signup = () => {
  return (
    <Base>
      <Container>
        <Card>
          <CardHeader>
            <h3>Register</h3>
          </CardHeader>
		  <CardBody>
			<Form>
				<FormGroup>
					<Label for="name">Enter Name</Label>
				</FormGroup>
			</Form>
		  </CardBody>
        </Card>
      </Container>
    </Base>
  );
};

export default Signup;
